script: |
  super -f tsv -I q1632.sql | sort > q1632.out

vector: true

inputs:
  - name: q1632.sql
    data: |
      SELECT DISTINCT * FROM tab2 AS cor0 WHERE ( + CAST ( - col2 AS REAL ) ) < - col2 + + - 53 + - - ( col0 ) * + 60 * - - 8;
  - name: tab2

outputs:
  - name: q1632.out
    data: |
      46	51	23
      64	77	40
      75	67	58
